def findLargest(L):
    n = len(L)
    if n == 1:
        return L[0]

    left = 0
    right = len(L) - 1

    while left <= right:
        mid = (left + right )// 2

        if mid == right:
            next_to_mid = 0
        else:
            next_to_mid = mid + 1

        if L[mid]  > L[next_to_mid]:
            return L[mid]
        else:
            if L[mid] < L[0]:
                right = mid -1
            else:
                left = mid + 1



